import React from "react";

export default (props) => {
  let url =
    "https://fretmap.app/scale-major/root-" + props.tonica + "/hand-right";

  return (
    <div>
      <iframe className = 'm-5'
        width="560"
        height="315"
        src="https://www.youtube.com/embed/L9PeqG9C5os"
        frameborder="0"
        allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture"
        allowfullscreen
      ></iframe>
      <iframe src={url} width="100%" height="375" />
    </div>
  );
};
